function minCost(N: number, A: number, R: number, M: number, H: number[]): number {
  let dp = H.map(height => new Map());
  dp[0].set(H[0], 0);

  for (let i = 1; i < N; i++) {
    dp[i] = new Map();
    for (const [h, cost] of dp[i - 1].entries()) {
      // Put a brick on top of the current pillar
      const newHeight = h + 1;
      if (!dp[i].has(newHeight)) {
        dp[i].set(newHeight, INF);
      }
      dp[i].set(newHeight, Math.min(dp[i].get(newHeight)!, cost + A));
      // Remove a brick from the top of the current pillar
      if (h > 0) {
        if (!dp[i].has(h - 1)) {
          dp[i].set(h - 1, INF);
        }
        dp[i].set(h - 1, Math.min(dp[i].get(h - 1)!, cost + R));
      }
      // Move a brick from the top of the current pillar to the top of another pillar
      for (const [prevHeight, prevCost] of dp[i - 1].entries()) {
        if (prevHeight > h && !dp[i].has(h)) {
          dp[i].set(h, INF);
        }
        dp[i].set(h, Math.min(dp[i].get(h)!, prevCost + M));
      }
    }
  }

  return Math.min(...dp[N - 1].values());
}


