class InputReader:

    def __init__(self, stdin: io.IOBase) -> None:
        """Initializes the Input Reader class."""
        self.stdin = stdin
        self.sep_list = ['\n']

    def add_sep(self, sep: str) -> None:
        """Adds a separator to split lines."""
        self.sep_list.append(sep)

    def read_str(self) -> str:
        """Reads the whole line as a string."""
        return self.stdin.readline().strip()

    def read_int(self) -> int:
        """Reads a single integer as a string."""
        return int(self.read_str())

    def read_strs(self) -> List[str]:
        """Reads multiple strings and returns a list."""
        return self.read_str().split()

    def read_ints(self) -> List[int]:
        """Reads multiple integers as a list of strings."""
        return [int(i) for i in self.read_str().split()]

    def read_str_sep(self) -> str:
        """Reads string input from a multiline string input."""
        for sep in self.sep_list:
            if sep in self.stdin:
                stdin, self.stdin = self.stdin, self.stdin[self.stdin.index(sep) + len(sep):]
                return stdin[:-len(sep)]

        self.stdin, lines = '', [l.strip() for l in self.stdin.splitlines()]
        return lines[-1]

    def read_int_sep(self) -> int:
        """Reads integer input from a multiline string input."""
        return int(self.read_str_sep())


